import './App.css';
import Intro from './components/Intro.js';
import Contact from './components/Contact.js';
import NavBar from './components/NavBar.js';
import AboutMe from './components/AboutMe.js'

function App() {
  return (
    <div className="App">
        <div id="content">
          <NavBar/>
          <Intro/>
          <AboutMe/>
          <Contact/>
        </div>
    </div>
  );
}

export default App;
